def transform(sequence):
    zero_count = 0
    transformed_sequence = []
    for num in sequence:
        if num == 0:
            zero_count += 1
        else:
            transformed_sequence.extend([0] * zero_count + [num])
            zero_count = 0
    transformed_sequence.extend([0] * zero_count)
    return transformed_sequence
